import { defineComponent, PropType } from "vue";
import { TemplateProps } from "@/store/index";
export default defineComponent({
  name: "TemplateList",
  props: {
    list: {
      type: Array as PropType<TemplateProps[]>,
      required: true,
    },
  },
  setup(props) {
    console.log("TemplateList props received:", props.list);
  },
});
